import React from 'react';
import { ArrowRight } from 'lucide-react';
import ItemCard from './ItemCard';
import LoadingSpinner from './LoadingSpinner';
import { Link } from 'react-router-dom';

const ProductGrid = ({ items = [], loading = false, title = "Featured Items", showViewAll = true }) => {
  // Show only first 8 items for landing page (2 rows x 4 columns)
  const displayItems = items.slice(0, 8);

  if (loading) {
    return (
      <div className="w-full">
        <div className="flex items-center justify-between mb-8">
          <div>
            <h2 className="text-2xl font-bold text-secondary-900 mb-2">{title}</h2>
            <p className="text-secondary-600">Discover amazing pieces from our community</p>
          </div>
        </div>
        <div className="text-center py-12">
          <LoadingSpinner size="lg" />
          <p className="text-secondary-600 mt-4">Loading amazing items...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="w-full">
      {/* Section Header */}
      <div className="flex items-center justify-between mb-8">
        <div>
          <h2 className="text-2xl font-bold text-secondary-900 mb-2">{title}</h2>
          <p className="text-secondary-600">Discover amazing pieces from our community</p>
        </div>
        {showViewAll && (
          <Link 
            to="/browse" 
            className="btn-outline flex items-center space-x-2 text-sm"
          >
            <span>View All</span>
            <ArrowRight className="w-4 h-4" />
          </Link>
        )}
      </div>

      {/* Product Grid */}
      {displayItems.length > 0 ? (
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6">
          {displayItems.map((item) => (
            <ItemCard key={item.id} item={item} />
          ))}
        </div>
      ) : (
        <div className="text-center py-16">
          <div className="w-16 h-16 bg-secondary-100 rounded-full flex items-center justify-center mx-auto mb-6">
            <svg className="w-8 h-8 text-secondary-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M7 7h.01M7 3h5c.512 0 1.024.195 1.414.586l7 7a2 2 0 010 2.828l-7 7a2 2 0 01-2.828 0l-7-7A1.994 1.994 0 013 12V7a4 4 0 014-4z" />
            </svg>
          </div>
          <h3 className="text-xl font-semibold text-secondary-900 mb-2">No items available yet</h3>
          <p className="text-secondary-600 mb-6 max-w-md mx-auto">
            Be the first to list an item and start building our sustainable fashion community!
          </p>
          <div className="flex flex-col sm:flex-row items-center justify-center gap-4">
            <Link to="/register" className="btn-primary">
              Join ReWear
            </Link>
            <Link to="/add-item" className="btn-outline">
              List Your First Item
            </Link>
          </div>
        </div>
      )}

      {/* Call to Action for more items */}
      {displayItems.length > 0 && showViewAll && (
        <div className="mt-12 text-center">
          <p className="text-secondary-600 mb-4">Want to see more amazing items?</p>
          <Link to="/browse" className="btn-primary inline-flex items-center space-x-2">
            <span>Browse All Items</span>
            <ArrowRight className="w-4 h-4" />
          </Link>
        </div>
      )}
    </div>
  );
};

export default ProductGrid;
